import React from "react";
// import Header from "./header";
import Scripts from "./bottomContainer";
import MediaCard from "./Card";
import HeadTag from "./HeadTag";
import Button from '@mui/material/Button';
import ArrowBackIcon from '@mui/icons-material/ArrowBack';
import dataSet from "./dataSet";

function Project() {

    const fullDiv = {
        "margin": "10%",
    }

    const anchorStyle = {
        "text-decoration": "none"
    }

    const allProjects = dataSet();

    return (
        <div>
            <HeadTag Title="Python" />
            <div className="container-fluid">

                <div style={fullDiv} className="row">

                    {allProjects.map(function(object, i) {
                        {console.log(object)}

                        <div className="col-lg-4 col-md-6 col-sm-6 themes-img">
                            <MediaCard
                                Title={object.Title}
                                Image="https://picsum.photos/200/300"
                                Desc="Lizards are a widespread group of squamate reptiles, with over 6,000
                    species, ranging across all continents except Antarctica"
                            />
                        </div>

                    })}
                    <Button> <a style={anchorStyle} href="/themes"> <ArrowBackIcon /> All Themes </a> </Button>

                </div>
            </div>
            <Scripts></Scripts>
        </div>
    )
};

export default Project;
